INSERT INTO products (id, Createdate, image, name, price, categoryid, number, available, description) VALUES (33, '2022-12-29', 'bia4.jpg', 'Bia Heineken Pháp 5% – Chai 250ml – Thùng 20 chai', 265.3, 'B', 66, 1, 'Heineken Lager hay bia Heineken, là một loại bia nhạt với nồng độ cồn 5% và có nguồn gốc từ công ty sản xuất bia ở Amsterdam, Hà Lan, do Gerard Adriaan Heineken thành lập vào năm 1864. Đến 2012, Heineken đã sở hữu gần 190 nhà máy sản xuất bia ở hơn 70 đất nước khác nhau và hiện là thương hiệu sản xuất bia lớn thứ 3 thế giới. Năm 1990, nhà máy HEINEKEN Việt Nam, trực thuộc tập đoàn HEINEKEN ở Hà Lan được thành lập. Tính đến nay, HEINEKEN Việt Nam đã và đang điều hành 6 nhà máy ở Hà Nội, Quảng Nam, Đà Nẵng, Vũng Tàu, thành phố Hồ Chí Minh, Tiền Giang và được xếp làm nhà sản xuất bia lớn thứ 2 trong nước. Với công nghệ tiên tiến hiện đại cùng công thức sản xuất bia độc quyền, HEINEKEN Việt Nam ngày càng chiếm trọn tình cảm người tiêu dùng bởi sự đa dạng, phong phú nhiều loại sản phẩm khác nhau. Đồng thời nhờ sự phổ biến của sản phẩm, HEINEKEN Việt Nam hằng năm đều đóng góp gần 0,9% GDP cho nền kinh tế đất nước. 🍊🌰🥝🍐🍏🍎🍳🚌🌰🍐🍎🍏 Nhờ nguồn nguyên liệu thiên nhiên, tinh khiết được nhập khẩu từ châu Âu, đồng thời quá trình ủ bia có sử dụng loại men Heineken A-Yeast độc quyền, giúp mỗi ly bia khi được thưởng thức đều sẽ mang màu vàng óng đẹp mắt, mùi thơm lúa mạch dịu nhẹ và hương vị độc đáo, hơi chua chua, ngọt ngọt cũng như vô cùng sảng khoái. Bên cạnh đó, bia Heineken còn gây được sự ấn tượng với thị trường tiêu thụ bởi việc không ngừng đa dạng hóa các dòng sản phẩm khác nhau, cụ thể gần đây nhất chính là sự cho ra đời của bia Heineken 0.0% nồng độ cồn, giúp phù hợp với nhiều độ tuổi, giới tính hơn và đảm bảo về vấn đề sức khỏe. ');
